import React from 'react'
import "./hotel.css"
import Navbar from '../../components/navbar/Navbar'
import Header from '../../components/header/Header'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  // faCircleArrowLeft,
  // faCircleArrowRight,
  // faCircleXmark,
  faLocationDot,
} from "@fortawesome/free-solid-svg-icons";
const Hotel = () => {
  const photos = [
    {
      src: "https://media.gettyimages.com/id/1223308726/photo/luxury-five-stars-hotels-lobby.jpg?s=2048x2048&w=gi&k=20&c=aTzQyb5NdJd6BaHtkYhGIXwsHhT_6ToU4y5fK82E6f4="
    },
    {
      src: "https://media.gettyimages.com/id/1142884533/photo/modern-luxury-bedroom.jpg?s=2048x2048&w=gi&k=20&c=_3XZOlLUjAq3aBl5Jc8De3aIdFYXwDNcZy6eB5k8Ahc="
    },
    {
      src: "https://media.gettyimages.com/id/1154732332/photo/luxury-hotel-exterior.jpg?s=2048x2048&w=gi&k=20&c=OfLSBC0mUuFayucBZwI8RX-wcJGV8jF0qv7Xbz1y35U="
    },
    {
      src: "https://media.gettyimages.com/id/1222443850/photo/luxury-construction-hotel-with-swimming-pool-at-sunset.jpg?s=2048x2048&w=gi&k=20&c=uhWvZJxWsWXpHqQL9GZPR9vCME5V35CvLZibNMTZsRA="
    },
    {
      src: "https://media.gettyimages.com/id/1142884892/photo/luxury-bedroom-interior.jpg?s=2048x2048&w=gi&k=20&c=pjN1bs1WXxBN5UoW8iY8_h6wPpxR3w9XJ9C2VBAAnX4="
    }
  ];
  
  
  return (
    <div>
      <Navbar/>
      <Header type="list"/>
      <div className="hotelContainer">
      <div className="hotelWrapper">
      <h1 className="hotelTitle">data.name</h1>
            <div className="hotelAddress">
              <FontAwesomeIcon icon={faLocationDot} />
              <span>data.address</span>
            </div>
            <span className="hotelDistance">
              Excellent location  data.distance m from center
            </span>
            <span className="hotelPriceHighlight">
              Book a stay over data.cheapestPrice at this property and get a
              free airport taxi
            </span>
            <div className="hotelImages">
               {photos.map(photo=>(
                <div className="hotelImgWrapper">
                 <img src={photo.src} alt="uu" className="hotelImg" /> 
                </div>
               ))}
              </div>
    </div>
    </div>
    </div>
  )
}

export default Hotel
